<p>阅读源码时，特别留意一下四大对象</p>
<ul>
<li><code>Executor (update, query, flushStatements, commit, rollback, getTransaction, close, isClosed)</code></li>
<li><code>ParameterHandler (getParameterObject, setParameters)</code></li>
